// External (npm) dependencies
import React, { useEffect, useState }  from 'react';
import configration from '../../../config.json';

export function IntroductorySection(props) {
  // const client = props.client;
  const { client, automationData, selectedMenuOption } = props;
  const authConnectionName = client.pluginClientInstance.context.availableConnections[0];
  const [ automationState, updateAutomationCreatedState ] = useState(false);
  useEffect(() => {
    CreateAndEditAutomation();
  }, []);
  console.log('props', props);

  function CreateAndEditAutomation() {
    client.disableSaveButton();
    console.log('client....', client);
    (async () => {
      if(authConnectionName) {
        try {
          const survey_id =  client.pluginClientInstance.context.userMeta.surveyId;
          // setCreateAutoLoading(true);
          //const start_dateObj = startDate !== '' ? moment(startDate).format('YYYY-MM-DD') : moment(new Date()).format('YYYY-MM-DD');
          //const end_dateObj = endDate !== ''  && isDateToggled ?  moment(endDate).format('YYYY-MM-DD') : '2030-12-30';
          const url = configration.auth_url;
          const config = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: { 'query': 'qualtrics_ext.mutation.setupExtensionBasedAutomation', 'tag': 'qualtrics_ext', 'variables': { 'add_data': { 'is_extension_based': true, 'platform_id': 16, 'effective_from': automationData.startDate, 'effective_to': automationData.endDate, survey_id, 'max_reward_count': (!automationData.isMaxRewardToggled) ? null : automationData.maxCountValue ? automationData.maxCountValue : null, 'instantApproval': automationData.approvalType === 'yes' ? false : true, 'reward_amount': selectedMenuOption.denomination_value, 'currency_code': selectedMenuOption.currencyCode, 'campaignId': selectedMenuOption.campaignId, 'template_id': selectedMenuOption.mail_template_id, 'batchexpirydate': automationData.selectedLinkExpiry, 'enable_repeat_rewarding': automationData.isAllowRepeatRewarding } } },
          };

          config.connection = {
            connectionName: authConnectionName,
            paramFormat: 'header',
            paramName: 'Authorization',
            paramTemplate: 'Bearer %s'
          };

          // console.log('props....', props);
          // moveToNextPage(2);
          // setPageErrorMsg('');
          const result = await client.fetch(url, config);
          // setCreateAutoLoading(false);
          if(result && result.responseData && result.responseData.data && result.responseData.data.setupExtensionBasedAutomation &&  result.responseData.data.setupExtensionBasedAutomation.success) {
            console.log('ghj');
            updateAutomationCreatedState(true);
            client.enableSaveButton();

            //props.updateSuccessState();

          } else {
            updateAutomationCreatedState(false);
            props.updateFailedState(result.responseData.data.setupExtensionBasedAutomation.message ? result.responseData.data.setupExtensionBasedAutomation.message  : 'failed to create automation');
          }

        } catch(error) {
          updateAutomationCreatedState(false);
          props.updateFailedState('failed to create automation');
          console.log(error);

        } finally {
        //  setIsLoading(false);
        }
      } else {

        // setIsLoading(false);
      }
    }
    )();

  }

  return (

    <div className='wrap section-content'>
      <div className='center-text'>
        <div>
          {automationState ? <img src={require('../../asserts/success.svg')} alt="success" style={{ marginBottom: '15px' }}/> : <NoAutomations/> }
        </div>
        {!automationState ? <div className='loding-gif'>
          <img src={require('../../asserts/shape-loader-icon.gif')} alt="loading..." style={{ 'height': '200px' }}/>
        </div> : null }
        <div className='config-heading'>{automationState ? 'Your automation settings have been saved!' : 'Configuring your automation settings...'}</div>
        <div className='config-sub-heading'>{automationState ? 'Success! Our pigeons have successfully configured & saved your automation settings for this workflow.  Please click \'Next\' to proceed to map the survey respondent\'s email address.' : 'Hang tight - our pigeons are on their way to configure your reward automation settings for this workflow task. This should not take long...'}</div>
      </div>
    </div>
  );
}

